class Solution(object):
    def __init__(self):
        self.sub_score_dict = {} # "end": {"start": 1}, can matched pair
        self.max_score_list = []

    def maximumGain(self, s, x, y):
        """
        :type s: str
        :type x: int
        :type y: int
        :rtype: int
        """
        stack = list(s)
        big_char, less_char = ('ab', 'ba') if x > y else ('ba', 'ab')
        big_score, less_score = (x, y) if x > y else (y, x)
        stack, big_count = self.check_count(list(s), big_char)
        stack, less_count = self.check_count( stack, less_char)
        # print big_count, less_count, x,y
        return big_count * big_score + less_count * less_score

    def check_count(self, s, chars):
        if len(s) < 2:
            return [], 0
        stack = []
        stack.append(s[0])
        count = 0
        for i in range(1, len(s)):
            stack.append(s[i])
            if len(stack) < 2:
                continue
            if str(stack[-2]) + str(stack[-1]) == chars:
                count += 1
                stack.pop()
                stack.pop()
        return stack, count

